import React from "react";
import Search from "../actions/Search";
import AddBook from "../addToList/AddBook";
import logoApp from "../images/favooks.png"
import add from "../images/plus.png"

export default function Nav() {

    return(
        <>
            <div className="nav-logo">
                <a href="../App.js"><img src={logoApp} alt="logo"/></a>
                <div className="nav">
                   <button> <a href="../actions/Add.js"><img src={add} alt="dodaj"/></a><AddBook/></button>
                    <Search/>
                </div>
            </div>
        </>
    )
};
